CREATE TABLE `purchases` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `paymentdate` varchar(25) COLLATE utf8mb4_spanish_ci NOT NULL,
  `status` varchar(30) COLLATE utf8mb4_spanish_ci NOT NULL DEFAULT 'ToDo',
  `finishdate` varchar(25) COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `report` varchar(255) COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `clientdetails` varchar(266) COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `id_payment` int(11) NOT NULL,
  `id_developer` int(11) DEFAULT NULL,
  `id_product` int(11) NOT NULL,
  `id_seller` int(11) DEFAULT NULL,
  `id_client` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_developer` (`id_developer`),
  KEY `id_product` (`id_product`),
  KEY `id_seller` (`id_seller`),
  KEY `id_client` (`id_client`),
  KEY `id_payment` (`id_payment`),
  CONSTRAINT `purchases_ibfk_1` FOREIGN KEY (`id_developer`) REFERENCES `developers` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `purchases_ibfk_2` FOREIGN KEY (`id_product`) REFERENCES `products` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `purchases_ibfk_3` FOREIGN KEY (`id_seller`) REFERENCES `sellers` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `purchases_ibfk_4` FOREIGN KEY (`id_client`) REFERENCES `clients` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `purchases_ibfk_5` FOREIGN KEY (`id_payment`) REFERENCES `payments` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish_ci;


